/**
 * A signature definition of comparator.
 * This type has same to an argument of `Array#sort`.
 */

/**
 * A type of comparator's result.
 */
export function numericGreaterFirst(a, b) {
  return a > b ? 1 : a < b ? -1 : 0;
}
export function dictOrderGreaterFirst(_a, _b) {
  var a = _a.toString();

  var b = _b.toString();

  return a > b ? 1 : a < b ? -1 : 0;
}
export var defaultComparator = dictOrderGreaterFirst;
